import React, { useState } from "react";
import Particles from "react-tsparticles";
import Modal from "react-modal";
import Map from "./Map";
import Contact from "./Contact";
import Social from "./Social";

Modal.setAppElement("#root");

const CallToAction = () => {
	const [isOpen, setIsOpen] = useState(false);
	
	function toggleModalOne() {
		setIsOpen(!isOpen);
	}
	
	return (
		

		<div className="tm_section" id="contact">
			<div className="frame-layout__particles">
					<Particles
						id="tsparticles"
						options={{
							backgroundMode: {
								enable: true,
								zIndex: 1,
							},
							fullScreen: {
								enable: false,
								zIndex: -1,
							},
							fpsLimit: 70,
							interactivity: {
								detectsOn: "canvas",
								events: {
									onClick: {
										enable: false,
										mode: "push",
									},
									onHover: {
										enable: false,
										mode: "repulse",
									},
									resize: true,
								},
								modes: {
									bubble: {
										distance: 400,
										duration: 2,
										opacity: 0.4,
										size: 40,
									},
									push: {
										quantity: 4,
									},
									repulse: {
										distance: 200,
										duration: 0.4,
									},
								},
							},
							particles: {
								color: {
									value: "#ddd",
								},
								links: {
									color: "#ffffff",
									distance: 150,
									enable: true,
									opacity: 0.5,
									width: 1,
								},
								collisions: {
									enable: true,
								},
								move: {
									direction: "none",
									enable: true,
									outMode: "bounce",
									random: false,
									speed: 2,
									straight: false,
								},
								number: {
									density: {
										enable: true,
										value_area: 800,
									},
									value: 30,
								},
								opacity: {
									value: 0.5,
								},
								shape: {
									type: "circle",
								},
								size: {
									random: true,
									value: 6,
								},
							},
							detectRetina: true,
						}}
					/>
				</div>

			<div
				className="tm_talk bg_image_props"
				style={{
					backgroundImage: `url(${
						process.env.PUBLIC_URL + "/img/callto-action/1.jpg"
					})`,
				}}
			>
				<div className="shape">
					<img className="svg" src="/img/svg/paper.svg" alt="partners brand" />
				</div>
				{/* End shape */}
				
				<div className="background" id="talk">
					<a className="player"></a>
					<div className="overlay"></div>
				</div>
				{/* End background */}
				
				<div className="talk_inner">
					<div className="text" data-aos="fade-up" data-aos-duration="1200">
						<h3>Let's work together!</h3>
					</div>
					
					<div
						className="button"
						data-aos="fade-up"
						data-aos-duration="1200"
						data-aos-delay="100"
					>
						<button className="white-fill-bg" onClick={toggleModalOne}>
							Connect with me
						</button>
					</div>
				</div>
				{/* End talk_inner */}
			</div>
			{/* Start Modal */}
			
			<Modal
				isOpen={isOpen}
				onRequestClose={toggleModalOne}
				contentLabel="My dialog"
				className="custom-modal"
				overlayClassName="custom-overlay"
				closeTimeoutMS={500}
			>
				<div className="tm_mobalbox_contact">
					<button className="close-modal" onClick={toggleModalOne}>
						<img src="/img/svg/cancel.svg" alt="close icon" />
					</button>
					{/* End close icon */}
					
					<div className="box_inner">
						<div className="description_wrap scrollable">
							{/* Start modal content */}
							<div className="title">
								<h3>Get in touch</h3>
							</div>
							{/* End title */}
							
							<div className="wrapper">
								<div className="left">
									<div className="fields">
										<Contact />
									</div>
								</div>
								{/* End left */}
								
								<div className="right">
									<div className="map_wrap">
										<Map />
									</div>
								</div>
								{/* End right */}
							</div>
							{/* End wrapper */}
							
							<div className="short_info">
								<ul>
									<li>
										<div className="list_inner">
											<img
												className="svg"
												src="img/svg/location.svg"
												alt="location"
											/>
											<p>Katy, TX</p>
										</div>
									</li>
									{/* End single address */}
									
									<li>
										<div className="list_inner">
											<img
												className="svg"
												src="img/svg/phone.svg"
												alt="phone"
											/>
											<p><a href="tel:+1 832 870 7177">+1 (832) 870-7177</a></p>
										</div>
									</li>
									{/* End silgle address */}
									
									<li>
										<div className="list_inner">
											<img
												className="svg"
												src="img/svg/share.svg"
												alt="share"
											/>
											<Social />
										</div>
									</li>
									{/* End silgle address */}
								</ul>
							</div>
							{/* End modal conetent */}
						</div>
					</div>
					{/* End box inner */}
				</div>
				{/* End modalbox news */}
			</Modal>
			{/* End modal */}
		</div>
	);
};

export default CallToAction;
